import Planet from './Planet'

class System {

    constructor() {
        this.planets = []
    }

    new_planet(color, radius, x, y) {
        planet = new Planet(self, color, radius, x, y)
        return planet
    }

}

export default System

export const system = new System()

system.new_planet('yellow', 9, 100, 100)

system.new_planet('red', 5, 120, 80)
